export default {
    data(){
      return{
          item:'',
      }
    },
    created() {
        this.getParams()
        document.title = this.item.title
        this.wxConfig();
    },
    methods:{
        getParams() {
            // 取到路由带过来的参数
            this.item = JSON.parse(this.$route.query.pipedata)
        },
        pipeData() {
            this.$router.push({
                path: '/submit',
                name: 'submit',
                query: {
                    pipedata: JSON.stringify(this.item)
                }
            })
        },
    },
}
